              <li>Tumour volume</li>
              <li>Tumour Weight (g)</li>
          </ol>
          </li>
          <li>Calculate
          <ol>
              <li>mean + SEM Volume by group by measurement date</li>
              <li>mean - SEM Weight by group by measurement date</li>
          </ol>
          </li>
